import React, { Component } from 'react';
import Layout from '../../components/Layout';

class DetalleQueja extends Component {

    render() {
        return (
            <Layout>
                <h3>Detalle de la Queja</h3>
            </Layout>
            
        );
    }

}

export default DetalleQueja;
